import { Routes, Route, NavLink } from 'react-router-dom'
import './App.css';
import About from '../about/About'
import Landing from '../landing/Landing'
import Errror from '../error/Error'

function App() {
  // const idk = process.env.REACT_APP_GOOGLE
  return (
    <div className="App">
      <header>
        <nav>
          <h1>T4Tp</h1>
          <NavLink></NavLink>
        </nav>
      </header>
      <main>
        <Routes>
          <Route to='/'/>
          <Route to='/About'/>
          <Route to='/'/>        
        </Routes>
      </main>
    </div>
  );
}

export default App;
